import React, { Component } from 'react';

class Notification extends Component {
    render() {
        return (
            <div className="col-md-3 h-100 p-2 shadow rounded-lg bg-light">
                <p>This is some sample text</p>
                <hr></hr>
                <a href="#">Message</a>
            </div>
        );
    }
}

export default Notification;
